DROP TABLE IF EXISTS wereldeconomie, indicatoren, landen;

CREATE TABLE indicatoren (INDICATOR_CODE VARCHAR(255), INDICATOR_NAME VARCHAR(255), SOURCE_NOTE VARCHAR(1000), SOURCE_ORGANIZATION VARCHAR(1000));


CREATE TABLE landen (Country_Code VARCHAR(255), Region VARCHAR(255), IncomeGroup VARCHAR(255), CountryName VARCHAR(255));



CREATE TABLE wereldeconomie (Country_Code VARCHAR(255), Indicator_Code VARCHAR(255), Year VARCHAR(255), KPI VARCHAR(255));

